class SentenceEmbeddingsAggregator(override val uid: String)
  extends AnnotatorModel[SentenceEmbeddingsAggregator]
    with HasSimpleAnnotate[SentenceEmbeddingsAggregator] {

  /** Output annotator type: SENTENCE_EMBEDDINGS */
  override val outputAnnotatorType: AnnotatorType = SENTENCE_EMBEDDINGS

  /** Input annotator type : SENTENCE_EMBEDDINGS */
  override val inputAnnotatorTypes: Array[String] = Array(AnnotatorType.SENTENCE_EMBEDDINGS)

  /** Names of input annotation cols containing embeddings */
  override def setInputCols(value: Array[String]): this.type = set(inputCols, value)

  /** Aggregator to calculate embeddings. DEFAULT: average OPTIONS: average, max, min */
  val aggregator: Param[String] = new Param[String](this, "aggregator", "Aggregator to calculate embeddings")

  /** Aggregator to calculate embeddings */
  def getAggregator(): String = $(aggregator)

  /** Aggregator to calculate embeddings. DEFAULT: average OPTIONS: average, max, min */
  def setAggregator(value: String): this.type = {
    validateAggregator(value)
    set(aggregator, value)
  }

  /** to validate aggregator whether it is max or min or average */
  private def validateAggregator(aggregator: String): Unit = {
    val lowerCased = aggregator.trim.toLowerCase
    require(lowerCased == "average" || lowerCased == "max" || lowerCased == "min",
      "Aggregator must be one of these: average, max, min")
  }

  /** Aggregator to calculate embeddings. DEFAULT: average OPTIONS: average, max, min
   * overloaded method to take Aggregator enum as parameter */
  def setAggregator(value: Aggregator.Value): this.type = set(aggregator, value.toString)

  /** overload constructor */
  def this() = this(Identifiable.randomUID("SENTENCE_EMBEDDINGS_AGGREGATOR"))

  setDefault(
    aggregator -> "average"
  )

  override def annotate(annotations: Seq[Annotation]): Seq[Annotation] = {
    val filteredAnnotations = annotations.filter(_.annotatorType == AnnotatorType.SENTENCE_EMBEDDINGS)
    val divisor = filteredAnnotations.length / getInputCols.length
    val maxLength = annotations.map(_.embeddings.length).max
    filteredAnnotations.zipWithIndex.filter(p => p._2 < divisor)
      .map { case (annotation, idx) =>

        val embeddings = ArrayBuffer[Float]()
        for (index <- 0 until maxLength) {

          get(aggregator).getOrElse("average") match {

            case "average" =>
              embeddings.append(findAverage(getEmbeddingsFromAnnotations(annotations, divisor, idx, index)
                .aggregate(0.0f, 0)((sum, y) => (sum._1 + y, sum._2 + 1), (x, y) => (x._1 + y._1, x._2 + y._2))))

            case "max" =>
              embeddings.append(getEmbeddingsFromAnnotations(annotations, divisor, idx, index).max)

            case "min" =>
              embeddings.append(getEmbeddingsFromAnnotations(annotations, divisor, idx, index).min)

          }

          def getEmbeddingsFromAnnotations(annotations: Seq[Annotation], divisor: Int, idx: Int, index: Int): Seq[Float] = {
            annotations.zipWithIndex.filter(p => p._2 % divisor == idx)
              .map(_._1.embeddings.lift(index)).filter(embed => embed.isDefined).map(_.get)
          }
        }
        Annotation(outputAnnotatorType, annotation.begin, annotation.end, annotation.result,
          annotation.metadata, embeddings.toArray)
      }

  }

  private def findAverage(tuple2: (Float, Int)): Float = tuple2._1 / tuple2._2

}
